import CommonState from "./common"
import UserState from "../pages/userInfo/stroe"
import RegisterState from "@pages/register/store"
import HomeState from "@pages/home/store"

const commonState = new CommonState();
const userState = new UserState();
const registerState = new RegisterState();
const homeState = new HomeState();
const store = {
  commonState,
  userState,
  registerState,
  homeState
}

export default store
